	 /**
     * @title 修改登陆密码
     * @desc  (用户修改登陆密码)
     * @input {"name":"old_pwd","require":"true","type":"int","desc":"旧登录密码"}
     * @input {"name":"new_pwd","require":"true","type":"int","desc":"新登录密码"}
     * @input {"name":"new_pwd_again","require":"true","type":"int","desc":"确认新登录密码"}
     * @output {"name":"code","type":"int","desc":"200:成功,300各种提示信息"}
     * @output {"name":"msg","type":"string","desc":"信息说明"}
     */
	public function   updatePwd(){
		$id=$this->getId();
		$old_pwd=trim($this->input->post('old_pwd'));
		$new_pwd=trim($this->input->post('new_pwd'));
		$new_pwd_again=trim($this->input->post('new_pwd_again'));
		
		/*$id=1;
		$old_pwd='123456';
		$new_pwd='888888';
		$new_pwd_again='888888';*/
		$new_pwd_str=strlen($new_pwd);
		if (!$old_pwd) {
            show300('原密码不能为空');
        }
        if (!$new_pwd) {
            show300('新密码不能为空');
        }
		if($new_pwd_str<6){
			show300('密码长度不能少于6位');
		}
        if (!$new_pwd_again) {
            show300('确认新密码不能为空');
        }
		$this->member_model->start();
		$is_res=$this->member_model->getwhererow(['id'=>$id],'pwd');
		if($is_res['pwd']!=$old_pwd){
			show300('原密码不正确');
		}
		if($new_pwd!=$new_pwd_again){
			show300('两次密码输入不一致');
		}
		$mem['pwd']=$new_pwd;
		$is_upd=$this->member_model->updatewhere(['id'=>$id],$mem);
		if($is_upd){
			$this->member_model->commit();
			show200('更改成功');
		}else{
			$this->member_model->rollback();
			show300('更改失败');
		}
	}
	
