    public function getLoginYzm()
    {
        //$str = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
        $str = '0123456789';
        $loginYzm = "";
        for ($i = 0; $i < YAMLENGTH; $i++) {
