	/**
     * @title 判断认证的阶段
     * @desc  (判断用户认证走到了哪一步 )
     * @output {"name":"code","type":"int","desc":"300:信息说明"}
     * @output {"name":"msg","type":"string","desc":"信息说明"}
     * @output {"name":"data.tag","type":"int","desc":"1认证页面2缴费页面3上传截图4审核等待页5认证通过页6认证不通过页加一个重新认证按钮"}
     */
	public function getValid(){
		$id=1;
		//$id=$this->getId();
		$res_pay=$this->member_model->getwhererow(['id'=>$id],'china_id,is_pay');
		if(empty($res_pay['china_id'])){
			$data['tag']=1;
			//show200($data,'认证页面  认证接口');
		}else{
			if($res_pay['is_pay']==0){
				$data['tag']=2;
				//show200($data,'掉缴费页面  确认完成缴费接口');
			}else{
				$is_pay=$this->member_pay_record_model->getwhererow(['user_id'=>$id],'screenshots');  
				if(empty($is_pay)){
					$data['tag']=3;
					//show200($data,'掉上传截图页面 上传截图接口 ');
					}else{
							$res_audit=$this->member_audit_model->getwhererow(['user_id'=>$id],'status');
							if($res_audit['status']==2){
								$data['tag']=4;
								//show200($data,'掉等待页');
							}else if($res_audit['status']==1){
								$data['tag']=5;
								//show200($data,'掉认证通过页');
							}else if($res_audit['status']==0){
								$data['tag']=6;
								//show200($data,'掉认证不通过页,重新认证,重新开发接口，认证编辑接口');
							}else{
								$data['tag']=7;
								//show200($data,'接口错误');
							}	
				
					}
				}
			}
		show200($data);
	}
    //升级会员等级判断
    public function updateLevel($id=19)
    {
        // print_r($id);exit;
        if (!$id) {
            show300('会员id不能为空');
        }
        //执行两次
        for($i=0;$i<=1;$i++){
            $ids = $this->member_model->getSup($id, $n = 0);
            $ids = explode(',', $ids);
            $where['is_valid'] = 1;
            $where_in = [
                'field' => 'id',
                'data' => $ids
            ];
            $data = $this->member_model->getWhere($where, $select = '*', $dbArray = [], $where_in);
            if (!empty($data)) {
                foreach ($data as $val) {
                    $pwhere=[
                        'referee_id'=>$val['id'],
                        'is_valid' => 1,
                    ];
                    $temp=$this->member_model->getWhere($pwhere,$select='id',$dbArray=[],$where_in=[]);
                    $result=[];//获取直推id
                    if($temp){
                        foreach ($temp as $val1){
                            array_push($result,$val1['id']);
                        }
                    }
                    switch ($val['member_lvl']) {
                        case "2":
                            $num = 3;
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>1
                            ];
                            break;
                        case "3":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>2
                            ];
                            $num = 3;
                            break;
                        case "4":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>3
                            ];

                            $num = 3;
                            break;
                        case "5":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>4
                            ];
                            $num = 3;
                            break;
                        case "6":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>5
                            ];
                            $num = 3;
                            break;
                        case "7":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>6

                            ];
                            $num = 3;
                            break;
                        case "8":
                            $cWhere = [
                                'is_valid' => 1,
                                'member_lvl' =>7
                            ];
                            $num = 3;

                            break;

                        default:
                            $cWhere = [
                                'is_valid' => 1,
                                'referee_id' => $val['id'],
                                'member_lvl' => 1

                            ];
                            $num = 9;
                    }
                    $cWhere_in = [
                        'field' => 'referee_id',
                        'data' => $result
                    ];


                    if($val['member_lvl']==1){
                        $count = $this->member_model->getWhere_num($cWhere);//0级升一级，9个直推
                    }else{
                        //除一级以外的升级
                        $count =$this->member_model->getRefereeNum($cWhere,$dbArray=[],$cWhere_in,$groupBy='referee_id');

                    }


                    //升级
                    if ($count >= $num) {
                        $update['member_lvl'] = $val['member_lvl'] + 1;
                        $referee_id = $this->member_model->updateWhere(['id' => $val['id']], $update);

                    }

                }
            }
        }


        return true;
    }

